import React from "react";
import './App.css';

function Neo({name, danger}) {
  console.log(String(danger));
  const danger_str = (String(danger) ? "Yes" : "No");

  return(
    <div className="Neo">
      <h1> Name: {name} </h1>
      <p> Potentially Dangerous?: {danger_str} </p>
      <img src="" alt="" />
    </div>
  );
}

export default Neo;
